import React from 'react';
import web from '../src/images/webpic.jpg'
import { NavLink } from 'react-router-dom/cjs/react-router-dom.min';
import Common from './Common';

const Home = () => {
    return (
        <>
           <Common 
            name="Grow your Business wi" 
            imgsrc={web} 
            visit="/contact" 
            btname="Contact Now"/>
           />
        </>
    )
}
export default Home;
